    "2016-11-25T21:06:24.938066",nt"name": "high-school-longitudinal-study-of-2009",nt"isopen":
    true,nt"url": null,nt"notes": "The High School Longitudinal Study of 2009
    (HSLS:09) is part of the High School Longitudinal Study (HSLS) program. HSLS:09
    (http://nces.ed.gov/surveys/hsls09/) is a longitudinal survey that follows more
    than 21,000 9th graders in 944 schools throughout their secondary and postsecondary
    years. The study focuses on understanding students' trajectories from the beginning
    of high school into postsecondary education, the workforce, and beyond. Key statistics
    produced from the HSLS:09 are what students decide to pursue when, why, and how.",nt"license_title":
